export default function GetTabAnalytics(instance) {

    const data = null;

    fetch("https://htxrockets.com/api/archived-game/0022101142/tabAnalytics/" + instance.tab )
    .then( (res) => res.json() )
    .then( (res) => {
        // data { logs[], totalViews, avgViewTime, totalTimeLogged }
        data = res.data;
        },
        (error) => { 
            const Error = error;
            console.log(Error);
        }
    );


    return null;

}
